import ReactAnime from 'react-animejs'
import { useState } from 'react';

function App() {
  const { Anime } = ReactAnime;

  return (
    <div className="App">
      <Anime
        initial={[
          {
            targets: ".sky",
            translateX: 50,
            easing: "linear"
          }
        ]}
      >
        <div className="sky">
          <h1>React App</h1>
        </div>
      </Anime>
    </div>
  );
}

export default App;
